import React, { useState, useEffect } from "react";
import { doploon_optimization } from "../services/axiosRequests";

const FormDoploon = ({
  handleSubmit,
  scrolls,
  placeholders,
  sizes,
  buttons,
}) => {
  const [doploons, setDoploons] = useState();
  const [small, setSmall] = useState();
  const [medium, setMedium] = useState();
  const [great, setGreat] = useState();
  const [powerful, setPowerful] = useState();
  const [selectedScroll, setSelectedScroll] = useState();
  const [turnOff, setTurnOff] = useState(true);

  useEffect(() => {
    if (
      small >= 0 &&
      medium >= 0 &&
      great >= 0 &&
      powerful >= 0 &&
      selectedScroll
    )
      setTurnOff(false);
  }, [small, medium, great, powerful, selectedScroll]);

  const handleCalculate = async (e) => {
    e.preventDefault();

    const result = await doploon_optimization({
      "doploons": doploons,
      "small": small,
      "medium": medium,
      "great": great,
      "powerful": powerful,
    });

    setDoploons("");
    setSmall("");
    setMedium("");
    setGreat("");
    setPowerful("");
    setSelectedScroll("");

    handleSubmit(result, selectedScroll);
  };

  return (
    <form className='flex gap-2 p-2' style={{ flexDirection: "column" }}>
      <div className='flex justify-between items-center font-bold'>
        <span className='font-extrabold text-xl opacity-60'>Doploons:</span>
        <input
          type='number'
          className='ml-10 text-gray-700 font-bold  border-gray-300 rounded-md py-2 text-center sm:text-sm placeholder-gray-400 focus:outline-none focus:ring-1 focus:ring-gray-500 focus:border-gray-500 bg-transparent'
          placeholder={placeholders[0]}
          value={doploons}
          onChange={({ target: { value } }) => setDoploons(value)}
        />
      </div>
      <div className='flex justify-between items-center font-bold'>
        <span className='font-extrabold text-xl opacity-60'>{sizes[0]}</span>
        <input
          type='number'
          className='ml-10 text-gray-700 font-bold  border-gray-300 rounded-md py-2 text-center sm:text-sm placeholder-gray-400 focus:outline-none focus:ring-1 focus:ring-gray-500 focus:border-gray-500 bg-transparent'
          placeholder={placeholders[1]}
          value={small}
          onChange={({ target: { value } }) => setSmall(value)}
        />
      </div>
      <div className='flex justify-between items-center font-bold'>
        <span className='font-extrabold text-xl opacity-60'>{sizes[1]}</span>
        <input
          type='number'
          className='ml-10 text-gray-700 font-bold  border-gray-300 rounded-md py-2 text-center sm:text-sm placeholder-gray-400 focus:outline-none focus:ring-1 focus:ring-gray-500 focus:border-gray-500 bg-transparent'
          placeholder={placeholders[1]}
          value={medium}
          onChange={({ target: { value } }) => setMedium(value)}
        />
      </div>
      <div className='flex justify-between items-center font-bold'>
        <span className='font-extrabold text-xl opacity-60'>{sizes[2]}</span>
        <input
          type='number'
          className='ml-10 text-gray-700 font-bold  border-gray-300 rounded-md py-2 text-center sm:text-sm placeholder-gray-400 focus:outline-none focus:ring-1 focus:ring-gray-500 focus:border-gray-500 bg-transparent'
          placeholder={placeholders[1]}
          value={great}
          onChange={({ target: { value } }) => setGreat(value)}
        />
      </div>
      <div className='flex justify-between items-center font-bold'>
        <span className='font-extrabold text-xl opacity-60'>{sizes[3]}</span>
        <input
          type='number'
          className='ml-10 text-gray-700 font-bold  border-gray-300 rounded-md py-2 text-center sm:text-sm placeholder-gray-400 focus:outline-none focus:ring-1 focus:ring-gray-500 focus:border-gray-500 bg-transparent'
          placeholder={placeholders[1]}
          value={powerful}
          onChange={({ target: { value } }) => setPowerful(value)}
        />
      </div>
      <select
        className='font-extrabold text-xl bg-transparent opacity-60'
        value={selectedScroll}
        onChange={({ target: { value } }) => setSelectedScroll(value)}
        defaultValue='Tipo do pergaminho'
      >
        <option
          disabled
          className='text-base font-black'
          value='Tipo do pergaminho'
        >
          {scrolls[0]}
        </option>
        <option className='text-base' value='str'>
          {scrolls[1]}
        </option>
        <option className='text-base' value='int'>
          {scrolls[2]}
        </option>
        <option className='text-base' value='wis'>
          {scrolls[3]}
        </option>
        <option className='text-base' value='agi'>
          {scrolls[4]}
        </option>
        <option className='text-base' value='cha'>
          {scrolls[5]}
        </option>
        <option className='text-base' value='vit'>
          {scrolls[6]}
        </option>
      </select>
      <button
        className={`bg-green-700 rounded ${
          turnOff ? "hover:bg-green-600" : null
        } p-2 font-extrabold text-white mt-4`}
        onClick={(e) => handleCalculate(e)}
        disabled={turnOff}
      >
        {buttons}
      </button>
    </form>
  );
};

export default FormDoploon;
